
DROP TABLE IF EXISTS tbl_employee_detail;

CREATE TABLE `tbl_employee_detail` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `emp_id` int(11) unsigned NOT NULL COMMENT 'FK - tbl_employee',
  `address_1` varchar(150) DEFAULT NULL,
  `address_2` varchar(150) DEFAULT NULL,
  `city` varchar(50) DEFAULT NULL,
  `state_id` int(2) unsigned DEFAULT NULL COMMENT 'FK - tbl_state_master',
  `zip` varchar(12) DEFAULT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `mobile` varchar(12) DEFAULT NULL,
  `modified_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `profile_image` varchar(100) DEFAULT NULL COMMENT 'user profile image path',
  `company_name` varchar(255) NOT NULL,
  `rjil_ext` varchar(255) NOT NULL,
  `building_name` varchar(255) NOT NULL,
  `floor` varchar(255) NOT NULL,
  `work_location` varchar(255) NOT NULL,
  `facebook_link` varchar(255) NOT NULL,
  `linkedin_link` varchar(255) NOT NULL,
  `twitter_link` varchar(255) NOT NULL,
  `sol_par_id` int(11) NOT NULL COMMENT 'Primary key of tbl_circle_sol_par_map',
  `atp1a_sol_par_map_id` int(11) NOT NULL COMMENT 'Primary key of tbl_atp1a_circle_solpar_map',
  `inst_sol_par_map_id` int(11) NOT NULL COMMENT 'Primary key of tbl_inst_circle_solpar_map',
  PRIMARY KEY (`id`),
  KEY `IX_employee_detail_user_id` (`emp_id`),
  KEY `NewIndex1` (`state_id`),
  KEY `sol_par_id` (`sol_par_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2929 DEFAULT CHARSET=latin1;



